import React, { Component } from "react";

class ChannelType extends Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="col-12">
          <div className="row">
            <div className="grid-container">
              <span>Filmler</span>
              <span>Diziler</span>
              <span>Belgeseller</span>
              <span>Canlı TV</span>
              <span>Çocuk</span>
            </div>
          </div>
        </div>
      </div>
    );
  }
}

export default ChannelType;
